import './App.css';
import Task from './Task';
import DcProgress from './DcProgress';

function App() {
  return (
    <div className="App">
      <div className="fixed top-0 right-15 z-10 p-4">
        <DcProgress />
      </div>
      <Task />
    </div>
  );
}

export default App;
